import React from "react";
import PropTypes from "prop-types";
import Link from "next/link";
import { Menu } from "antd";

const LangdingLayout = ({ children }) => {
  return (
    <div>
      <div>
        <img></img>
        <p>NextPus</p>
      </div>
      <div>
        <Menu mode="horizontal">
          <Menu.Item>
            <Link href="/">
              <a>노드버드</a>
            </Link>
          </Menu.Item>
          <Menu.Item>
            <Link href="/profile">
              <a>프로필</a>
            </Link>
          </Menu.Item>
          <Menu.Item>
            <Link href="/signup">
              <a>노드버드</a>
            </Link>
          </Menu.Item>
        </Menu>
      </div>
      {children}
    </div>
  );
};

LangdingLayout.propTypes = {
  children: PropTypes.node.isRequired,
};

export default LangdingLayout;
